COPY public.program (id, description, identifier, name, sampling) FROM stdin;
172	The Alboran Sea (SW Mediterranean) lies at an active tectonic setting, and the seabed is constantly affected by chronic and catastrophic geological hazards. This proposal focuses on the Ceuta Canyon, a large-scale downslope feature overlooked as a mere boundary geological feature of the adjacent and much larger Ceuta Drift. However, a) its location is tectonically controlled and seems to be related to onshore active structures; b) its head (located close to the coast) and the eastern margin are affected by arcuate-shaped scars; and c) it is deeply influenced by vigorous bottom currents that cause erosion on its margins and the rapid growth of the Ceuta Drift. This context in which tectonism, bottom currents and sedimentary instabilities show a complex interplay raises concerns regarding the high exposure of coastal populations to geohazards. In addition, new projects to place electrical and telecommunications connections in between Spain and Morocco are endangered. This proposal aims to study the geological risks in the Ceuta Canyon and its annex areas with a multidisciplinary lens, focusing on the sedimentary processes, chrono-stratigraphy, and oceanography. To properly tackle this task, ultra-high resolution imaging of the seafloor must be carried out. For that, the incorporation of an AUV will allow geohazard mapping with unprecedented precision, providing higher resolution datasets than those achieved from surface vessels with traditional techniques.	GRACE	GRACE	\N
173	The SEAQUAKE Project aims to characterize the coseismic surface deformation related to the occurrence of the 25 January 2016 Mw 6.4 earthquake in the submarine Al-Idrissi Fault System (AIFS) and its previous earthquake history (i.e., number of earthquakes, displacement per event, slip-rate and chronology of events). This project will benefit from the ultra-high resolution data acquired during the SHAKE project and cruise (2015), which focused in the acquisition of bathymetry and sub-bottom seismic profiles by using AUVs (AsterX and IdefX from IFREMER) along the southern segment of the AIFS. By re-visiting the area and acquiring new AUV data along the rupture area, we will have access to a pre- and a post-earthquake information that will allow comparing both datasets to identify and characterize the deformation associated with the 2016 event. In addition, SEAQUAKE plan to collect piston cores in designated locations along a pseudo-3D TOPAS survey, which will allow to characterize the upper Quaternary seismostratigraphy and deformation history of the AIFS and to study the triggering relationship between earthquakes and mass transport deposits. To achieve these objectives, we request a 3-days cruise on board the RV Belgica II together with the AUV AsterX or IdefX from IFREMER. Having access to this equipment will mean the possibility to acquire AUV ultra-high-resolution bathymetric data, together with acoustic datasets and sediment samples with the equipment provided by the vessel. A research team of 3 people, together with the EF+ project scientific team, will work on data acquisition and processing on board, but a group involving 7 more remote participants will also be involved in the consecution of the scientific objectives of the project. This group results from years of collaboration between Spanish and international institutions. Outreach and dissemination of results to the general public will be a major objective of this project, including live, real-time communications during the cruise. Communication of results to the scientific community will be done through participation in scientific conferences and publication in international, high-impact journals.	SEAQUAKE	SEAQUAKE	\N
